import React, { Component } from 'react'
import ReactPlayer from 'react-player'
import Paper from '@material-ui/core/Paper'
import { Button } from '@material-ui/core'

const Axios = require('axios')

class MainFeed extends Component{

  state = {
          source: this.props.source,
          name: this.props.name,
          port: this.props.port,
          buttonNames: this.props.buttonNames,
          finished: false
    }  

    render(){

        let player = {
            marginTop: '5px'
        }

        let buttonGridStyle={
            width: '700px',
            height: '200px',
            textAlign:'center'
        }

        let buttons = {
            marginLeft: '15px', 
            width: '670px', 
            height:'180px', 
            display: 'grid',
            gridTemplateColumns: 'repeat(6, 111.66px)'
        }

        let btns = this.state.buttonNames.map((d, i) => {
          console.log(d)
          return <Button key={i}>{d}</Button>
      })

        return(

            <div>
                <div style={{width: '700px', height: '420px', backgroundColor: '#333'}}>
                    <ReactPlayer url={'https://www.youtube.com/watch?v=F4SY7kTpqjk'} playing muted controls={false} className={player} width="100%" height="100%"/>
                    <div style={{marginTop: '15px'}}>
                        <h1 style={{marginLeft: '15px'}}>{this.state.name}</h1>
                    </div>
                    <div style={buttonGridStyle}>
                        <div style={buttons}>
                            {btns}
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default MainFeed
